import React from 'react';
import List from './List';
import sdata from './Sdata';

const Amazon = () => {
  return (
    <List
      key={sdata[1].id}
      imgsrc={sdata[1].imgsrc}
      title={sdata[1].title}
      sname={sdata[1].sname}
      link={sdata[1].link}
    />
  );
};

export default Amazon;
